import React, { Component } from "react";

import { Provider } from "react-redux";
import { createStore, combineReducers, applyMiddleware } from "redux";
import { Route, Switch, withRouter } from "react-router-dom";
import Layout from "./components/Layout/Layout";
import Home from "./containers/Home/Home";
import MediumSofa from "./components/Sofa/MediumSofa/MediumSofa.js";
import MediumRespaldo from "./components/Respaldo/MediumRespaldo/MediumRespaldo";
import RespaldoBuilder from "./containers/RespaldoBuilder/RespaldoBuilder";
import ResumenRespaldo from "./components/Respaldo/ResumenRespaldo/ResumenRespaldo";
import Carrito from "./containers/Carrito/Carrito";
import respaldoReducer from "./store/reducers/respaldo";
import homeReducer from "./store/reducers/home";
import carritoReducer from "./store/reducers/carrito";
import SeccionDePago from "./containers/Carrito/SeccionDePago/SeccionDePago";

const rootReducer = combineReducers({
  respaldo: respaldoReducer,
  home: homeReducer,
  carrito: carritoReducer,
});

const logger = store =>{
  return next =>{
    return action =>{
      console.log(action);
      const result = next(action);
      console.log('Midldeware, next state', store.getState())
      return result;
    }
  }
}

const store = createStore(rootReducer, applyMiddleware(logger));

class App extends Component {
  render() {
    let notPaying = (
      <Layout>
        <Switch>
          <Route
            path="/respaldo-options/respaldo-builder"
            component={RespaldoBuilder}
          />
          <Route path="/sofa-options" component={MediumSofa} />
          <Route path="/respaldo-options" component={MediumRespaldo} />
          <Route path={"/resumen-respaldo"} component={ResumenRespaldo} />
          <Route path={"/carrito"} component={Carrito} />
          <Route path="/" exact component={Home} />
        </Switch>
      </Layout>
    );

    if (this.props.history.location.pathname === "/pagos") {
      notPaying = <Route path="/pagos" component={SeccionDePago} />;
    }

    return <Provider store={store}>{notPaying}</Provider>;
  }
}

export default withRouter(App);
